import {useState} from 'react'

function Navigation(){
    const [ open, setOpen ] = useState(false);

    const toggleOpen = () => {
        setOpen(!open);
    }

    return (
        <div className="m-auto text-center shadow-md bg-gray-300 rounded-b-full w-2/6 h-2" onClick={() => toggleOpen()}>
        </div>
    )
}

export default Navigation
